import React, { Component } from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker,
  GoogleApiWrapper,
  InfoWindow,
  Map
} from "react-google-maps";

import axios from 'axios';

const CustomMap = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      defaultZoom={13}
      defaultCenter={{ lat: 35.894380, lng: 128.619268 }}
      defaultOptions={{
        scrollwheel: false,
        zoomControl: true
      }}
    >
      <Marker position={{ lat: 35.894380, lng: 128.619268 }} />
    </GoogleMap>
  ))
);

class Maps extends Component {
  render() {
    return ( // <CustomMap
      //   googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyA8Acop1PDTra-V8pBC19IzMSNhqvP9Z20"
      //   loadingElement={<div style={{ height: `70%` }} />}
      //   containerElement={<div style={{ height: `70vh` }} />}
      //   mapElement={<div style={{ height: `100%` }} />}
      // />
      <div className="map_section_50">
          <Map className="google-map"
            google = {this.props.google} 
            zoom={15}
            initialCenter= {{
              lat: 35.894380,
              lng: 128.619268
            }}
            onClick={this.addMarkers}
          >
          {/* {this.displayMarkers()}
          {this.displayMarkersAll()}
          {this.displayInfoWindows()} */}
        </Map>
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyA8Acop1PDTra-V8pBC19IzMSNhqvP9Z20'
})(Maps);
